import Home from "./home/Home";
import './app.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from "react-router-dom";
import Feature from "./component/feature/Feature";

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path = "/">
          <Home />
        </Route>
        <Route path = "/movies">
          <Home />
        </Route>
      </Switch>
    </Router>

  );

};

export default App;
